import * as React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { useHistory } from 'react-router';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import DeleteOutlineOutlinedIcon from '@material-ui/icons/DeleteOutlineOutlined';
import EditIcon from '@material-ui/icons/Edit';

import Tooltip from '@mui/material/Tooltip';
const useStyles = makeStyles({

  container: {
    maxHeight: 440,
  },
});


const MedicosTabla = ({ medicosList, isFetching }) => {
  const classes = useStyles();

  let history = useHistory();


  const StyledTableCell = withStyles((theme) => ({
    head: {
      backgroundColor: '#1976d2',
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);


  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }

  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];
  return (
    <TableContainer className={classes.container}>
      <Table stickyHeader >
        <TableHead     >
          <TableRow >
            <StyledTableCell align="left"  >Nombre y Apellido</StyledTableCell>
            <StyledTableCell align="right">Celular</StyledTableCell>
            <StyledTableCell align="right">Email</StyledTableCell>
            <StyledTableCell align="right">Matrícula N°</StyledTableCell>
            <StyledTableCell align="right">Estado</StyledTableCell>
            <StyledTableCell align="right" ></StyledTableCell>
            <StyledTableCell align="right" ></StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {medicosList && medicosList.map((row, index) => (
            <TableRow hover>
              <TableCell align="left">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.nombre}</TableCell>
              <TableCell align="right">{row.apellido}</TableCell>
              <TableCell align="right">{row.email}</TableCell>
              <TableCell align="right">{row.celular}</TableCell>
              <TableCell align="right">
                <Tooltip title="Editar" placement="right">
                  <EditIcon />
                </Tooltip>
              </TableCell>
              <TableCell align="left">
                <Tooltip title="Eliminar" placement="right">
                  <DeleteOutlineOutlinedIcon />
                </Tooltip>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
export default MedicosTabla;
